INSERT INTO `products` (`id`, `category`, `subCategory`, `productName`, `productCompany`, `productPrice`, `productPriceBeforeDiscount`, `productDescription`, `productImage1`, `productImage2`, `productImage3`, `shippingCharge`, `productAvailability`, `postingDate`, `updationDate`) VALUES
(25, 10, 18, 'Fortune Kachi Ghani Mustard Oil ( কাচ্চি ঘানি সারিষা তেল ), 1 Litre Pouch', 'Fortune', 120, 102, '<span style=\"color: rgb(102, 102, 102); font-family: Celias, Helvetica; font-size: 14px;\">Fortune Kachi Ghani Edible Oil is made from the first press of mustard seeds. Traditionally prepared, the strong aroma and taste of mustard oil adds a distinctive flavour to the dishes. Additionally, it helps in keeping the pickles fresh for a long duration and is great for deep frying.</span><br>', 'Fortune Kachi Ghani Mustard Oil, Packaging 1 Litre Pouch.jpeg', '276764-4_1-fortune-kachi-ghani-mustard-oil.jpg', '81M9Ok+RwrL._SY355_.jpg', 0, 'In Stock', '2019-07-27 05:37:30', NULL),
(26, 10, 18, 'Fortune Kachi Ghani Mustard Oil ( কাচ্চি ঘানি সরিষার তেল ), 500 gm bottle.', 'Fortune', 70, 74, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Fortune Kachi Ghani Mustard Oil, traditionally extracted from the first press of mustard seeds, comes with a high pungency level and strong aroma. Being pure, our cooking oil retains its natural properties and mustard oil benefits. Its strong aroma and pungency spice up your cooking.</span><br>', '500 gm.jpg', '276764-4_1-fortune-kachi-ghani-mustard-oil.jpg', '276764-5_1-fortune-kachi-ghani-mustard-oil.jpg', 0, 'In Stock', '2019-07-27 05:51:22', NULL),
(27, 10, 18, 'Saffola Gold - Pro Healthy Lifestyle Edible Oil, 5 L Jar', 'Saffola Gold ', 649, 825, '<ul style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><li style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px; line-height: 1.4;\">Saffola Gold, Pro Healthy Lifestyle Edible Oil is a blend of 80% refined rice bran oil and 20% refined safflower oil.</li><li style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px; line-height: 1.4;\">MUFA and PUFA: Saffola Gold has fatty acids to help give you a balance of MUFA and PUFA.</li><li style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px; line-height: 1.4;\">Nutri-Lock Technology and Multi-Seed Technology: Protects the natural goodness of the&nbsp;</li></ul>', '147493_12-saffola-gold-pro-healthy-lifestyle-edible-oil.jpg', '147493-4_2-saffola-gold-pro-healthy-lifestyle-edible-oil.jpg', '147493-6_1-saffola-gold-pro-healthy-lifestyle-edible-oil.jpg', 0, 'Out of Stock', '2019-07-27 06:09:07', NULL),
(29, 10, 18, 'Fortune Sunflower Refined Oil, 1 L Pouch', 'Fortune ', 98, 125, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Fortune Sunflower Oil is a light, healthy and nutritious cooking oil. Being rich in vitamins and consisting mainly of polyunsaturated fatty acids, it makes food easy to digest.</span><br>', 'fortune sunflower refined oil.jpg', 'fortune sunflower refined oil 2 .jpg', '274145-5_1-fortune-sunflower-refined 3 -oil.jpg', 0, 'Out of Stock', '2019-07-27 11:04:03', NULL),
(30, 10, 18, 'Fortune Soya Bean Oil, 1 L Pouch', 'Fortune ', 99, 120, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Fortune Soya Health Oil is processed with next-generation High Absorbent Refining Technology (H.A.R.T). So, your everyday meals not only taste better but also make your Bones stronger and your Heart and Eyes healthier.</span><br>', 'fortune-soya-bean-oil.jpg', 'fortune-soya-bean 2-oil.jpg', 'fortune-soya-bean 3 -oil.jpg', 0, 'In Stock', '2019-07-27 11:09:37', NULL),
(33, 8, 24, 'Ginger ( আদা )', 'NA', 25, 28, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">&nbsp;Organic products are organically grown and handpicked by expert</span><br>', '50000509-2_1-fresho-ginger-organically-grown.jpg', '50000509_4-fresho-ginger-organically-grown.jpg', '50000509-3_1-fresho-ginger-organically-grown.jpg', 0, 'In Stock', '2019-07-27 11:31:51', NULL),
(34, 8, 24, ' Garlic ( রসুন )', 'NA', 17, 20, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Fresho Organic products are organically grown and handpicked by expert.&nbsp;</span><br>', '50000507-2_1-fresho-garlic-organically-grown.jpg', 'close-up-of-garlic-on-table-760254411-5bcbf91c4cedfd0026f2b89d.jpg', '50000507_4-fresho-garlic-organically-grown.jpg', 0, 'In Stock', '2019-07-27 11:36:32', NULL),
