(50, 7, 13, 'Coconut - medium, 1pc ( নারকেল )', 'na', 25, 30, '<span style=\"color: rgb(55, 55, 55); font-family: Verdana, Helvetica, Arial, sans-serif; font-size: 12px;\">Coconut is a round and elongate fruit of white, fibrous and oily meat covered by a thick, brown and hairy shell. Coconuts are surrounded by a fibrous kernel, inside which is a white meat called copra. When the fruit is still tender it yields a milky fluid that is commonly used as basic food in some zones.</span><br>', 'is (6).jpg', 'is (4).jpg', 'is (5).jpg', 0, 'Out of Stock', '2019-08-02 12:28:19', NULL),
