(53, 7, 13, 'Watermelon-1 pc 1.25-2.5kg ( তরমুজ )', 'NA', 65, 100, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">With greenish black to smooth dark green surface, Fresho watermelons are globular in shape and are freshly picked for you directly from our farmers&nbsp;</span><br style=\"box-sizing: border-box; margin: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">The juicy, sweet and grainy textured flesh is filled with 12-14% of sugar content, making it a healthy alternative to sugary carbonated drinks. Flesh colour of these watermelons are pink to red with dark brown/black seeds.</span><br>', 'watermelon-2636_960_720.jpg', 'watermelon-1846051_960_720.jpg', 'melon-1537284_960_720.jpg', 0, 'Out of Stock', '2019-08-02 13:00:52', NULL),
