(55, 8, 27, ' Cabbage, 1 pc approx. 500 to 800 gm ( বাঁধাকপি )', 'NA', 20, 45, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">With a texture of crispness and juiciness the moment you take the first bite, cabbages are sweet and grassy flavoured with dense and smooth leafy layers</span>', 'download.jpg', 'download (1).jpg', 'images (2).jpg', 0, 'Out of Stock', '2019-08-03 02:53:22', NULL),
(56, 8, 27, 'Beetroot ( বীট )', 'NA', 50, 60, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Beetroot is in low fat, so you can make juice and enjoy your drinks with your family. It is a super food for roasting, blending it in blender and make juice, as well as for making different types of curry. It has a number of health benefits. Beetroot juice may help lower your blood pressure. Drinking beetroot juice increases plasma nitrate levels and boosts physical performance. It may improve muscle power in people with heart failure. It helps you to maintain a healthy weight etc.</span><br>', 'images (3).jpg', 'images (4).jpg', 'images (5).jpg', 0, 'In Stock', '2019-08-03 03:06:15', NULL),
(57, 8, 27, 'Capsicum - Green ( কেপসিকাম )', 'NA', 90, 100, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Leaving a moderately pungent taste on the tongue, Green capsicums, also known as green peppers are bell shaped, medium-sized fruit pods. They have thick and shiny skin with a fleshy texture inside.&nbsp;</span>', 'capcicum.jpg', 'Capsicum-Green.jpg', 'green cap.jpg', 0, 'In Stock', '2019-08-03 03:13:09', NULL),
(58, 8, 27, 'Carrot ( গাজর )', 'NA', 40, 50, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">A popular sweet-tasting root vegetable, Carrots are narrow and cone shaped. They have thick, fleshy, deeply colored root, which grows underground, and feathery green leaves that emerge above the ground. While these greens are fresh tasting and slightly bitter, the carrot roots are crunchy textured with a sweet and minty aromatic taste.&nbsp;</span><br>', 'carrots.jpg', '02735_01_hercules.jpg', 'download (2).jpg', 0, 'Out of Stock', '2019-08-03 03:18:49', NULL),
(59, 8, 27, 'Cucumber ( শসা )', 'NA', 30, 45, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">With high water content and crunchy flesh, Cucumbers have striped, light to dark green coloured skin that is edible.&nbsp;</span>', '31032019101540378 (1).png', 'download (5).jpg', 'download (4).jpg', 0, 'Out of Stock', '2019-08-03 03:24:05', NULL),
(60, 8, 27, 'Brinjal (বেগুন) ', 'NA', 20, 50, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Brinjal, is a very low calorie vegetable and has healthy nutrition. Several varieties of Brinjal grown all around the world. It contains good amounts of many essential B-complex groups of vitamins such as pantothenic acid (vitamin B5), pyridoxine (vitamin B6) and thiamine (vitamin B1), niacin (B3). These vitamins are essential in the sense that body requires them from external sources to replenish and required for fat, protein and carbohydrate metabolism. this vegetable is an also good source of minerals like manganese, copper, iron and potassium. Manganese is used as a co-factor for the antioxidant enzyme, superoxide dismutase. Potassium is an important intracellular electrolyte that helps counter pressing (hypertension) effects of sodium.</span><br>', 'blackbeauty-eggplant-1.jpg', 'download (6).jpg', '28_th.jpg', 0, 'In Stock', '2019-08-03 03:30:49', NULL),
(61, 8, 27, ' Bitter Gourd ( করলা )', 'NA', 40, 50, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">They are dark or light green in color depending on the region where they are grown. Though they taste very bitter, they are filled with many beneficial antioxidants and essential vitamins. Bitter gourd is a rich source of cellulose, which adds to you daily dietary requirement of fibre, improving digestion and helping prevent problems like dyspepsia and constipation. Besides it also contains antihelminthic compounds that can kill infectious worms in your stomach. Bitter gourd is an extremely rich source of Vitamin C which helps boost your immunity. A 100g serving of bitter gourd contains just 17 calories making it a great option for those who want to lose weight.</span><br>', 'bitter-gourd-500x500.jpg', 'fresh-bitter-gourd-500x500.jpg', 'Indian-Bitter-Melon1.jpg', 0, 'In Stock', '2019-08-03 03:36:17', NULL),
(62, 8, 27, ' Spine Gourd ( কাঁকরোল )', 'NA', 30, 35, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Scientific name of spine gourd is Momordica dioica. Spine gourd is a cucurbitaceous vegetable which is closely related to bitter gourd. However, it is not bitter in taste as bitter gourd. As in case of other cucurbitaceous vegetables (cucurbits) which mainly include melons and gourds, spine gourd is also grown as a summer vegetable in tropical and subtropical countries.</span><br>', 'zzzzzzzzz.jpg', 'images (6).jpg', 's-l300.jpg', 0, 'Out of Stock', '2019-08-03 03:44:51', NULL),
(65, 7, 13, 'Khajoor- 100g ( খেজুর )', 'Na', 12, 15, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Dates are a good source of vitamins, minerals and fibre despite their calories. It also serves as a relief from various health conditions and are a rich source of antioxidants and essential nutrients which are especially important for strengthening bones and treating constipation</span><br>', '7042019095935377.jpg', 'date.jpg', 'date.jpg', 0, 'Out of Stock', '2019-08-03 12:15:52', NULL),
