(79, 11, 60, 'Lifebuoy Total 10 Soap Bar 125 g ', 'Lifebuoy ', 28, 30, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">The Lifebuoy Total Soap Bar offers complete germ protection for you and your family. It is Worlds No. 1 selling germ protection soap. It is powered with Activ SILVER, one of natures most powerful ingredients that helps fight infection-causing germs. So give your family 100% better germ protection with Lifebuoy soap. Bathe regularly, that is, wash your body often after intervals that suit you with Lifebuoy soap with Activ silver which gives you protection from 10 infection causing germs.</span>', 'lifebuoy-soap-bar total 10 125g 1.jpg', 'lifebuoy-soap-bar total 10 125g 2.jpg', 'lifebuoy-soap-bar total 10 125g 3jpg.jpg', 0, 'In Stock', '2019-08-06 17:00:21', NULL),
(80, 11, 60, 'Lifebuoy Soap Bar - Care, Germ Protection, 125 g', 'Lifebuoy ', 28, 30, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Sensitive skin demands a balance between protection and care. The special formula of Lifebuoy Care Soap Bar contains the goodness of milk cream, which leaves the skin soft and smooth. Its advanced formula is designed to be mild on delicate skin while keeping it healthy and protecting it from germs. Also its powerful formula provides 100% protection from infection causing germs and features Active Silver, which is a strong germ protectant that penetrates the walls of germs to completely destroy them from within. Time to protect yourself and your family with Lifebuoy, the worlds number 1 selling germ protection soap.</span><br>', 'lifebuoy-soap-bar-care-germ-protection 125 g 1.jpg', 'lifebuoy-soap-bar-care-germ-protection 125 g 2.jpg', 'lifebuoy-soap-bar-care-germ-protection 125 g 3.jpg', 0, 'Out of Stock', '2019-08-06 17:06:53', NULL),
(81, 7, 14, 'Kismis- - 500 g  ( কিসমিস )', 'Na', 290, 350, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">The organic kismis are preserved and dried version of grapes. It is fine for the health. It can give relief from constipation, anemia, acidosis, fever. It is free from synthetic chemicals and pesticides.</span><br>', 'kismis.jpg', 'natural-dried-raisin-kismis--806.jpg', 'kismis-long-500x500.jpg', 0, 'Out of Stock', '2019-08-07 12:01:41', NULL),
(82, 7, 13, 'Sapota- 1 kg ( সবেদা )', 'Na', 100, 130, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Brown skinned sapotas are smooth to grainy textured, musky-scented and deliciously sweet in taste. The flesh generally contains 2-3 large and inedible black seeds. Fresho sapotas are freshly plucked by our farmers and the best quality is delivered to you.&nbsp;</span><br>', 'sofeda-sapodilla.jpg', 'sapota-fruit-to-be-riped-in-7-12-days-500x500.jpg', 'Chikoo---Elliptical-800x800.jpg', 0, 'Out of Stock', '2019-08-07 12:16:02', NULL),
