(84, 7, 13, 'Pomelo-250g', 'Na', 100, 130, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">With a bright red pulp that is sweet, juicy and a moderate amount of seeds, Pomelos are round with green to yellow thick rind.&nbsp;</span><br style=\"box-sizing: border-box; color: rgb(143, 143, 143); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: transparent !important;\"><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Fresho brings to you peeled pomelos that are easy to eat with no added preservatives.</span><br>', 'pomelo-fruit-01.jpg', 'il_340x270.1961514663_pweu.jpg', 'grapefruit-reinking-pomelo-14616532_80a3647f211c4bfd5945a50b6f4b98bf.jpg', 0, 'Out of Stock', '2019-08-07 12:40:25', NULL),
