(86, 7, 13, 'Small Apple', 'Na', 60, 80, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">fruit specially for the ones with a sweet tooth, apples are the sweetest apples around and come with a hint of vanilla flavour. These apples have creamy white, firm and finely grained flesh. These apples are crisp, juicy and sugary. Premium apples are handpicked by our experts to give you the best quality apples.</span><br>', '79-2T.jpg', 'download (5).jpg', 'download (5).jpg', 0, 'In Stock', '2019-08-07 12:51:58', NULL),
(92, 11, 60, 'Dove Bathing Bar Soap - Cream Beauty 100 gm', 'Dove ', 45, 50, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Dove Cream Beauty Bar combines a gentle cleansing formula with Doves signature 1/4 moisturizing cream to give you softer, smoother and more glowing skin. The mild cleansers help your skin to retain its natural moisture rather than stripping it away. Â&nbsp;This Dove bar even helps to replenish nutrients that are lost during the cleansing process - where a regular soap bar might leave your skin feeling dry and tight, a Dove White Bar leaves it feeling soft and smooth. Â&nbsp;Its not a soap - its a beauty barÂ&nbsp;Washing with regular soap can cause skin to feel dry, tight and irritated as some cleansing Ingredients strip skin of essential nutrients.&nbsp;</span><br>', 'Dove Bathing Bar Soap - Cream Beauty 100 gm 1.jpg', 'Dove Bathing Bar Soap - Cream Beauty 100 gm 2.jpg', 'Dove Bathing Bar Soap - Cream Beauty 100 gm 3.jpg', 0, 'Out of Stock', '2019-08-20 16:32:21', NULL),
(93, 11, 60, 'Dove Cream Beauty Bathing Bar Soap,50 gm', 'Dove ', 19, 20, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Dove Cream Beauty Bar combines a gentle cleansing formula with Doves signature 1/4 moisturizing cream to give you softer, smoother and more glowing skin. The mild cleansers help your skin to retain its natural moisture rather than stripping it away. &nbsp;This Dove bar even helps to replenish nutrients that are lost during the cleansing process - where a regular soap bar might leave your skin feeling dry and tight, a Dove White Bar leaves it feeling soft and smooth.&nbsp;</span><br>', 'Dove Cream Beauty Bathing Bar Soap, 50 g 2.jpg', 'Dove Cream Beauty Bathing Bar Soap, 50 gm 3.jpg', 'Dove Bathing Bar Soap - Cream Beauty 100 gm 3.jpg', 0, 'In Stock', '2019-08-20 20:48:20', NULL),
(95, 11, 60, 'Godrej Cinthol Cool Bath Soap, 125 g', 'Godrej Cinthol ', 43, 45, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Begin your day with a burst of icy-cool freshness with Cinthol Cool Bath Soap. Give yourself a refreshing shower every day with this bathing soap, as the rush of cooling menthol with Active Deo fragrance leaves you charged for the rest of the day. Beat the heat with Cinthol Cool Soap, as the icy-cool menthol makes your skin feel fresh, alive and summer-proof. With Cinthol Cool Soap, being Alive is Awesome.&nbsp;</span><br>', 'godrej-cinthol-cool-bath-soap 125gm 3.jpg', 'godrej-cinthol-cool-bath-soap 125gm 1.jpg', 'godrej-cinthol-cool-bath-soap 125gm 2.jpg', 0, 'Out of Stock', '2019-08-20 21:01:20', NULL),
(96, 11, 60, 'Godrej Cinthol Confidence+ Bath Soap, 125 gm', 'Godrej Cinthol ', 43, 45, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Cinthol Confidence+ Bath Soap lets you take on the world with complete confidence while offering 99.9% germ protection. A quick shower with this bathing soap and youâ€™ll be ready to take on what comes at you throughout the day! Cinthol Confidence+, one of the leading bathing soap brands in India, has the power of germ protection with an amazing deo fragrance. It makes you confident as you take on everyday challenges and brings you to life.&nbsp;</span><br>', 'godrej-cinthol-confidence-bath-soap 125 gm 11.jpg', 'godrej-cinthol-confidence-bath-soap 125 gm 3.jpg', '-godrej-cinthol-confidence-bath-soap 125 gm 2.jpg', 0, 'Out of Stock', '2019-08-20 21:10:47', NULL),
(99, 11, 60, 'Medimix Bathing SoapÂ -Â Ayurvedic Sandal, 75 gm', 'Medimix ', 34, 35, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Medimix Sandal and Eladi oils are successful for skin blemishes. It has a unique blend of Sandal oil and the time tested Ayurvedic formulation of Eladi Oil. It works successfully on dark spots, blemishes and other pigmentation marks leaving you with blemish-free, clear skin. This distinctive blend of ingredients also assists maintain your skin fresh and glowing.&nbsp;</span><br>', 'medimix-bathing-soapa-a-ayurvedic-sandal 75 gm 1.jpg', 'Medimix Bathing Soap - Ayurvedic Sandal, 125 g 2.jpg', 'Medimix Bathing Soap - Ayurvedic Sandal, 125 g 3.jpg', 0, 'Out of Stock', '2019-08-20 21:34:57', NULL),
