(102, 9, 29, 'India Gate Basmati Rice - Feast Rozzana 1kg', 'India Gate ', 86, 101, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">India Gate Feast Rozzana Basmati Rice is the long grain, sweet-smelling rice presents you a big time relish able delight to yourselves. It is completely apt for using in preparing numerous rice items. Wherever you eat in the World, India Gate Basmati Rice will be an essential part of every superiority rice recipe and on your platter to relish</span><br>', 'india-gate-basmati-rice-feast-rozzana 1kg 1.jpg', 'india-gate-basmati-rice-feast-rozzana 1kg 2.jpg', 'india-gate-basmati-rice-feast-rozzana 1kg 3.jpg', 0, 'In Stock', '2019-08-24 11:00:43', NULL),
(103, 9, 29, 'India Gate Basmati Rice - Feast Rozzana, 5kg', 'India Gate ', 348, 500, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">India Gate Basmati Rice Feast Rozzana is defined by its long grains and amazing aromatic flavour. Having this rice is truly having a feast rozzana (a daily feast); combine it with your veggies and serve a nice pulao. Without this Basmati Rice, your biryanis will seem dull and tasteless. This is the perfect ingredient for different rice recipes.&nbsp;</span><br>', 'india-gate-basmati-rice-feast-rozzana 5kg 1.jpg', '-india-gate-basmati-rice-feast-rozzana 5kg 2.jpg', 'india-gate-basmati-rice-feast-rozzana 5kg 3.jpg', 0, 'In Stock', '2019-08-24 12:26:17', NULL),
