(106, 8, 27, 'Lemon - 2pcs ( পাতিলেবু )', 'NA', 8, 10, '<span style=\"color: rgb(102, 102, 102); font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 14px;\">Lemon promotes hydration and keeps the skin healthy. They help ease digestion, prevents kidney stones and freshens breath. Lemons are a very good source of Vitamin C.</span><br>', 'download.jpg', 'download (1).jpg', 'download (2).jpg', 0, 'Out of Stock', '2019-08-25 11:44:28', NULL),
(107, 8, 27, 'Gandharaj Lemon -2 pcs ( গন্ধরাজ লেবু )', 'NA', 10, 12, '<span style=\"color: rgb(102, 102, 102); font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 14px;\">Lemon promotes hydration and keeps the skin healthy. They help ease digestion, prevents kidney stones and freshens breath. Lemons are a very good source of Vitamin C.</span><br>', 'images.jpg', 'images (4).jpg', 'download (2).jpg', 0, 'Out of Stock', '2019-08-25 11:57:20', NULL),
(108, 8, 27, 'Green Banana-1pc ( কাঁচকলা )', 'NA', 5, 7, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Green banana are the unripe version of yellow banana. While you can eat the yellow banana immediately after peeling, the green banana is best eaten cooked, either boiled or fried. Nutritionally, the green banana is a good source of fiber, vitamins and minerals, and contains a starch that may help control blood sugar, manage weight and lower blood cholesterol levels. Green bananas are also high in vitamin B-6, with a 1-cup boiled serving containing 39 percent of your daily value. Vitamin B-6 plays an important role in more than 100 enzymatic reactions in your body. It is also necessary for the formation of hemoglobin, the protein that carries oxygen in your body. Additionally, vitamin B-6 aids in blood sugar control.</span><br>', 'images (5).jpg', 'raw-banana-600x450.jpg', 'download (4).jpg', 0, 'In Stock', '2019-08-25 12:06:52', NULL),
(109, 8, 27, 'Banana flower 1pc. ( কলা মচা )', 'NA', 30, 41, '<span style=\"color: rgb(102, 102, 102); font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 14px;\">Banana blossoms reduce menstrual bleeding. They help reduce diabetes and anemia and are a rich source of vitamins and minerals.</span><br>', 'banana-flower 3.jpg', 'banana flower 3.jpg', 'banana-flower 1.jpg', 0, 'Out of Stock', '2019-08-25 12:21:17', NULL),
(110, 8, 27, 'Ridge Gourd ( ঝিঙে ) ', 'NA', 40, 45, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Ridge Gourd is a dark green, tapering and ridged vegetable. In contrast to its dark green exterior ridge gourd has white spongy pulp inside in white are embedded white seeds. Ridge gourd benefits is its low in cholesterol and saturated fats but high in vitamin C, dietary fiber, riboflavin, thiamin, zinc, iron, manganese and magnesium. Ridge gourd nutrition value makes it appropriate for weight loss plans. Usefulness of Ridge Gourd in Cookery, Health and Beauty.</span><br>', 'RIDGE GOURD 1.jpg', 'RIDGE GOURD  2.jpg', 'RIDGE GOURD  3.jpg', 0, 'In Stock', '2019-08-25 12:32:17', NULL),
(111, 8, 27, 'long Bean ( বরবটি )', 'NA', 40, 45, '<span style=\"color: rgb(34, 34, 34); font-family: sans-serif; font-size: 14px;\">They are a good source of protein, vitamin A, thiamin, riboflavin, iron, phosphorus, and potassium, and a very good source for vitamin C, folate, magnesium, and manganese.</span><br>', 'long-beans 3.jpg', 'longbeans 2.jpg', 'long-beans 3.jpg', 0, 'Out of Stock', '2019-08-25 12:42:47', NULL),
(112, 8, 27, 'Fresh Green Chilli  ( কাঁচা লঙ্কা )', 'NA', 110, 120, '<span style=\"color: rgb(0, 0, 0); font-family: roboto, Arial, Helvetica, sans-serif; font-size: medium;\">With a spicy bite, these fresh products are high in vitamins A and C.</span><br style=\"color: rgb(0, 0, 0); font-family: roboto, Arial, Helvetica, sans-serif; font-size: medium;\"><span style=\"color: rgb(0, 0, 0); font-family: roboto, Arial, Helvetica, sans-serif; font-size: medium;\">Green chillies are high in potassium and iron content.</span><br style=\"color: rgb(0, 0, 0); font-family: roboto, Arial, Helvetica, sans-serif; font-size: medium;\">', 'fresh-green-chili long 1.jpg', 'fresh-green-chili long 2.jpg', 'fresh green-chilli long 3.jpg', 0, 'Out of Stock', '2019-08-25 12:51:35', NULL),
(114, 8, 27, 'Pointed Gourd ( পটল )', 'NA', 60, 70, '<span style=\"color: rgb(38, 38, 38); font-family: Roboto, Arial, sans-serif; font-size: 19px;\">There are many health benefits of eating pointed gourd and are less known to the people. The vegetable is rated as one of the nutritious foods and is offering vitamins like vitamin A, vitamin B1, vitamin B2 and vitamin C. Pointed gourd also offers you very less calories and hence it helps to keep the cholesterol levels in control. In Ayurveda, pointed gourd is used to treat the gastric problems and is also used as a natural aphrodisiac that can improve sex life. Listed below are some of the popular health benefits of pointed gourd</span>', 'pointed_gourd.jpg', 'Fresh-parwal 3.jpg', 'Fresh-parwal 2.jpg', 0, 'Out of Stock', '2019-08-25 13:22:58', NULL),
