(118, 16, 31, 'Cookme Turmeric Powder ', 'Cookme', 10, 12, '<span style=\"color: rgb(109, 109, 109); font-family: goudy; font-size: 16px;\">Great quality brings great taste, is still Cookme’s core philosophy. Adequate care is taken, besides strict hygiene, to preserve the essential goodness of the spices.</span><br>', 'Cookme Turmeric Powder 100gm.jpg', 'istockphoto-916646590-612x612.jpg', 'turmeric-powder-.jpg', 0, 'In Stock', '2019-09-23 18:52:04', NULL),
(119, 16, 31, 'Sunrise Turmeric Powder ', 'Sunrise', 10, 10, '<p style=\"box-sizing: border-box; transition: all 1s ease 0s; padding: 0px; margin-bottom: 20px; text-align: justify; overflow: hidden; clear: both; color: rgb(56, 56, 56); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 15px;\">Its golden-yellow colour, warm, distinctively earthy flavour and proven anti-bacterial and healing properties tick all the boxes.</p><p style=\"box-sizing: border-box; transition: all 1s ease 0s; padding: 0px; margin-bottom: 20px; text-align: justify; overflow: hidden; clear: both; color: rgb(56, 56, 56); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 15px;\">Whole or ground, fresh or dried, turmeric’s many properties have made it an essential of basic as well as well-stocked kitchens across the world.</p><p style=\"box-sizing: border-box; transition: all 1s ease 0s; padding: 0px; margin-bottom: 20px; text-align: justify; overflow: hidden; clear: both; color: rgb(56, 56, 56); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 15px;\">Add in the religious and ritualistic significance it enjoys across India, and you know why vernacular words for this spice (haldi or holud, to name two), pop up in folk songs and folklore, not to mention traditions.</p><p style=\"box-sizing: border-box; transition: all 1s ease 0s; padding: 0px; margin-bottom: 20px; text-align: justify; overflow: hidden; clear: both; color: rgb(56, 56, 56); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 15px;\">No wonder, then, that this happy-coloured spice with a glow like that of the sun, is one of the only three kitchen ingredients (others being salt and ginger) used by more than 95 per cent of the population in India.</p>', 'turmeric-powder.jpg', 'Sunrise-Pure-Turmeric-Haldi-Powder-1535183697-10049358-2.jpg', 'East-End-Pure-Ground-Turmeric-Curcumin-Powder-Free.jpg', 0, 'Out of Stock', '2019-09-25 13:16:29', NULL),
