(121, 10, 33, 'Cookme Turmeric Powder ( হলুদ গুড়ো )', 'Cookme', 10, 10, '<span style=\"color: rgb(109, 109, 109); font-family: goudy; font-size: 16px;\">Great quality brings great taste, is still Cookme’s core philosophy. Adequate care is taken, besides strict hygiene, to preserve the essential goodness of the spices.</span><br>', 'Cookme Turmeric Powder 100gm.jpg', 'East-End-Pure-Ground-Turmeric-Curcumin-Powder-Free.jpg', 'istockphoto-916646590-612x612.jpg', 0, 'Out of Stock', '2019-09-25 13:57:23', NULL);
