(127, 10, 18, 'Saloni Mustered Oil 1Lit', 'Saloni', 95, 100, '<span style=\"color: rgb(0, 0, 0);\"><font size=\"3\">Saloni Mustard Oil is of 100% purity and is abstracted from the best quality mustard seeds. It is prepared by crushing mustard seeds in a wooden kolhus and then manufactured in a step by step process in a well-equipped laboratory, whose sole purpose is dedicated to manufacturing edible mustard oil.</font></span><br>', 'Saloni-Kachi-Ghani-Mustard-Oil-1-ltr-Pouch.jpg', 'Saloni-Kachi-Ghani-Mustard-Oil-1-ltr-Pouch.jpg', 'Saloni-Kachi-Ghani-Mustard-Oil-1-ltr-Pouch.jpg', 0, 'In Stock', '2019-10-23 10:24:28', NULL),
(128, 10, 18, 'Engine Mustard Oil Kacchi Ghani 1 Ltr. Pouch', 'Engine', 118, 120, '<span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 16px;\">We offer Engine Mustard Oil Kacchi Ghani 1 Ltr. Pouch Premium Quality, Agmark Grade- 1, with 5 layer Food Grade Film Pouches. A natural preservative, it makes an ideal choice for pickles, sauces, chutneys and marinades. Expelled from mature mustard seeds and filtered to perfection to retain its natural properties. Mustard oil with its high levels of MUFA (Mono-Unsaturated Fatty Acid) has a high smoke point, longer shelf life and therefore does not detoriate easily. Mustard oil is suitable for all types of cuisines, imparting its flavour and freshness to the food cooked in it.</span><br>', 'engine-mustard-oil-kacchi-ghani-1-ltr-pouch-500x500.jpg', 'engine-mustard-oil-kacchi-ghani-1-ltr-pouch-500x500.jpg', 'engine-mustard-oil-kacchi-ghani-1-ltr-pouch-500x500.jpg', 0, 'Out of Stock', '2019-10-23 10:32:37', NULL),
(129, 10, 18, 'Mashal Mustard Oil 1Lit Pouch', 'Mashal', 103, 110, '<p style=\"font-family: arial; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-size: 16px;\">Mashal Kachi Ghani Mustard oil is Agmark Grade -1, premium brand oil. Mashal Kachi Ghani Mustard Oil is manufactured in a traditional way with modern technology, where no chemical and high temperature heating is being used. Mashal brand oil is obtained from clean and sound Mustard seed of species like Brassica Compestris Linn (Yellow or Brown) Brassica Napus or a mixture of both.</p><p style=\"font-family: arial; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-size: 16px;\"><br style=\"margin: 0px; padding: 0px;\">The cold process helps to maintain the natural quality and aroma of oils. It has very low quantity of saturated fatty acid. Mashal Mustard Oil is a good source of mono unsaturated fatty acid with natural Omega-3 (Alfa Linolenic Acid). Omega-3 fatty acid is not synthesized by the human body. Therefore some extra source is required for the body to have omega -3 fatty acid. Mashal Brand Mustard Oil has suitable Omega-6 and Omega-3 ratio and appropriate mixture of both mono unsaturated and poly unsaturated fatty acid. It is very helpful in preventing early aging and making body cholesterol free. It has more vitamins &amp; antioxidant.</p>', '20180731_190003.jpg', 'mashal-edible-oils-500x500.jpg', '20180731_190003 (1).jpg', 0, 'Out of Stock', '2019-10-23 10:37:55', NULL),
