(146, 10, 33, 'Bay Leaves (Tejpata / তেজ পাতা )', 'NA', 5, 6, '<span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 16px;\">We are identified as one of a reputed&nbsp;</span><b style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: arial; font-size: 16px;\">Bay Leaf</b><span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 16px;\">&nbsp;Manufacturers in India. Cultivated in well-equipped and hygeinic farms, our Bay Leaf is free from chemicals and other impurities. Where Purity Is The Governing Factor. We ensure proper packaging of Bay Leaf confirming to only moisture free packaging material.</span><br>', 'tejpata-500x500 (1).jpg', 'tejpata-500x500.jpg', 'tiaj-pata.jpg', 0, 'Out of Stock', '2019-11-08 11:45:47', NULL),
