(149, 10, 33, 'Cumin Seeds ( Jeera / গোটা জিরা ) 50gm', 'NA', 25, 30, '<ul class=\"a-unordered-list a-vertical a-spacing-none\" style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 18px; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Shahi Jeera is also called Caraway seeds in English. These are darker and tastier than the normal Jeera (Cumin seeds).</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Shahi Jeera is used in cooking specific dishes like Korma, Mughali cuisines or Persian foods.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Shahi Jeera or Caraway seed is known to have medicinal value.</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">The seeds of Shahi Jeera will be longer, thinner and darker compared to regular Jeera or cumin seed</span></li></ul>', '67177617.jpg', 'images (2).jpg', 'SP_14-02_2048x.jpg', 0, 'In Stock', '2019-11-08 12:17:18', NULL),
(150, 8, 27, 'Radish (মুলা )', 'NA', 15, 30, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Radish is one of the nutritious root-vegetables featured in both raw salads as well as in main recipes. Snacking on radishes can help you reach your daily vitamin C intake goal. For their size, radishes have a high vitamin C content. A 1/2-cup serving offers 8.6 mg, or 14 percent of the recommended daily intake. Vitamin C works in the body to rebuild tissues, blood vessels and maintain bones and teeth.</span><br>', 'download.jpg', 'images (6).jpg', 'images (7).jpg', 0, 'In Stock', '2019-12-09 02:58:29', NULL),
(151, 8, 27, 'Sweet Pumpkin ( মিষ্টি কুমড়া ) ', 'NA', 25, 30, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Sweet Pumpkin is an extremely nutrient dense food, meaning it is chock-full of vitamins and minerals but low on calories. There are many creative ways pumpkin can be incorporated into your diet, including desserts, soups, salads, preserves and even as a substitute for butter. Sweet Pumpkin is a rich source of vitamin A. Sweet Pumpkin is one of the best-known sources of the antioxidant beta-carotene. Pumpkin puree or canned pumpkin can be used as a replacement for butter or oil in baking recipes.</span><br>', 'pumpkin 1.jpg', 'pumpkin 3.jpg', 'pumpkin 2jpg.jpg', 0, 'In Stock', '2019-12-09 03:05:36', NULL),
(152, 8, 27, 'Round Brinjals Green', 'NA', 20, 50, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Segoe UI&quot;, Helvetica, &quot;Droid Sans&quot;, Arial, &quot;lucida grande&quot;, tahoma, verdana, arial, sans-serif; font-size: 14px;\">Brinjals are mildly sweet, moist and never bitter. Because of their small size, the silky flesh is especially tender and will cook quickly. Try them sliced, brushed with olive oil and salt, and grilled or roasted. They also make a great addition to curries and stir-fries. It contains good amounts of many essential B-complex groups of vitamins such as pantothenic acid (vitamin B5), pyridoxine (vitamin B6) and thiamin (vitamin B1), niacin (B3). These vitamins are essential in the sense that body requires them from external sources to replenish and required for fat, protein and carbohydrate metabolism.</span><br>', 'brinjal-green.jpg', 'brinjal_2.png', 'images (8).jpg', 0, 'In Stock', '2019-12-09 03:28:42', NULL),
