(156, 7, 13, 'Mosambi 2 pic.', 'NA', 30, 40, '<span style=\"color: rgb(102, 102, 102); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px; background-color: rgb(247, 247, 247);\">Mosambi is a sweet lime. Its other names are sweet lemon and sweet limetta. Mosambi contains less acid than most orange varieties. It is loved for its mild and palatable flavour. It is rich in vitamin C, and a perfect detoxifying agent. Mosambi is also a powerhouse of antioxidants that help reduce inflammation, and improve immune system. It is a great medicine for constipation</span><br>', 'dm5860.jpg', 'mosambi-600x600.png', '10000191-4_2-fresho-mosambi.jpg', 0, 'In Stock', '2019-12-15 02:13:39', NULL),
