(163, 14, 16, ' Pampers Pampers Wipes - Baby Fresh Clean, 64 wipes', 'Pampers ', 140, 185, '<br><div><span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Every little miracle deserves gentle cleaning. Thanks to Pampers unique soft grip texture, Pampers Fresh clean wipes are soft and strong to offer gentle cleaning for your babys delicate skin. The wipes come with a refreshing scent and are dermatological tested. They also help restore the natural pH of your babys skin thus keeping it healthy and soft</span><br></div>', 'pampers-wipes-baby-fresh-clean 1.jpg', 'pampers-wipes-baby-fresh-clean 2.jpg', 'pampers-wipes-baby-fresh-clean 3.jpg', 0, 'In Stock', '2019-12-28 10:23:14', NULL),
