(207, 10, 33, 'Sunrise Panch phoran ( পাঁচ ফোড়ন )', 'Sunrise', 18, 20, '<p style=\"box-sizing: border-box; transition: all 1s ease 0s; padding: 0px; margin-bottom: 20px; text-align: justify; overflow: hidden; clear: both; color: rgb(56, 56, 56); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 15px;\">Paach phoron, literally five spice, contains fenugreek, black mustard, nigella, cumin and fennel seeds, in the same quantities each. Each of these aromatics is strong enough to hold its own, yet eager to work with others. This gives this blend an interesting piquancy that is almost instantly identifiable.</p><p style=\"box-sizing: border-box; transition: all 1s ease 0s; padding: 0px; margin-bottom: 20px; text-align: justify; overflow: hidden; clear: both; color: rgb(56, 56, 56); font-family: &quot;Libre Franklin&quot;, sans-serif; font-size: 15px;\">While this can easily be made at home, keep a packet of our Five Spice Mix handy if you want the surety of premium quality and perfect proportion.</p>', 'Sunrise-Pure-Five-Spice-Panch-Phoran-1550918749-10056621-1.jpg', 'Sunrise-Pure-Five-Spice-Panch-Phoran-1550918753-10056621-2.jpg', 'Sunrise-Pure-Five-Spice-Panch-Phoran-1550918757-10056621-3.jpg', 0, 'In Stock', '2019-12-28 18:44:55', NULL),
