(219, 10, 33, 'Sounf - Fennel Seeds ( মৌরি )  - 50 gm.', 'NA', 10, 12, '<span style=\"color: rgb(51, 51, 51); font-family: arial; font-size: 16px;\">The best quality of &nbsp;Sounf is offered by us to customers at market leading prices. We are offering this Sounf in safe packaging in order to maintain its longer shelf life. Moreover, the offered Sounf is extensively used in cooking to flavor the dishes. Our products are known for their rich flavor.</span><br>', '360272882-H-696x476.jpg', 'Fennel-Saunf-Big.png', 'images.jpg', 0, 'In Stock', '2019-12-28 19:07:08', NULL),
(220, 10, 33, 'Yellow Mustard Seed ( হলুদ সরিষা )- 100 gm.', 'NA', 12, 14, '<span style=\"color: rgb(34, 34, 34); font-family: &quot;Graphik Webfont&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Droid Sans&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Pure and Authentic Yellow Mustard Seeds from India. Also known as Pilli Sarso in Hindi language.</span><br style=\"margin: 0px; box-sizing: border-box; color: rgb(34, 34, 34); font-family: &quot;Graphik Webfont&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Droid Sans&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><br style=\"margin: 0px; box-sizing: border-box; color: rgb(34, 34, 34); font-family: &quot;Graphik Webfont&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Droid Sans&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\"><span style=\"color: rgb(34, 34, 34); font-family: &quot;Graphik Webfont&quot;, -apple-system, BlinkMacSystemFont, Roboto, &quot;Droid Sans&quot;, &quot;Segoe UI&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">Add Planet Spices Yellow Mustard Seeds in your Recipes for an Authentic Flavour &amp; Aroma.</span><br>', 'il_570xN.1986610210_qyci.jpg', 'Yellow-Mustard-Seeds.jpg', '11532099569.jpg', 0, 'In Stock', '2019-12-28 19:11:52', NULL),
(221, 10, 33, 'Red Mustard Seed ( লাল সরিষা )- 100 gm.', 'NA', 10, 14, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Tiny, mustard seeds have an interesting bite and they contribute to the exotic flavor and aroma of Indian food. If you are like most people, the word \"mustard\" probably conjures up images of ballparks and barbeques. Yet, once you add mustard seeds to your spice cabinet, the word will take on a whole new meaning, as you will also relish the spicy, aromatic rustic taste and fragrance that mustard can add to your meals. Mustard seeds are from the mustard plant, which is a cruciferous vegetable related to broccoli, Brussels sprouts and cabbage.</span><br>', 'Red-Mustard-Seeds.jpg', 'mustard-seed-500x500.jpg', '11532099451.jpg', 0, 'In Stock', '2019-12-28 19:14:15', NULL),
(223, 10, 33, ' Kala Jeera ( কালা জীরা )  Best Quality - 100 GM', 'NA', 22, 26, '<span style=\"color: rgb(0, 0, 0); font-family: Arial, sans-serif; font-size: 14px;\">Kalo jeera is a spice which is popular in Indian cuisine. It is used to flavor meat and rice dishes, with a distinct rich, nutty, slightly grassy taste. Kalo jeera is also sometimes known as black cumin.</span><br>', 'kala_jeera_1549624672.jpg', '5a4519aa8c27decfa5dd53a48dc874c5.jpg', '11532099315.jpg', 0, 'In Stock', '2019-12-28 19:16:11', NULL),
(226, 10, 33, 'JK Bay Leaf ( তেজ পাতা )- 50 GM', 'JK', 20, 22, '<span style=\"color: rgb(33, 33, 33); font-family: Roboto, Arial, sans-serif; font-size: 14px;\">Product information provided by the seller on the Website is not exhaustive, please read the label on the physical product carefully for complete information provided by the manufacturer. For additional information, please contact the manufacturer.</span><br>', '50-bayleaf-pouch-jk-whole-original-imafgyghweapb33g.jpeg', '50-bayleaf-pouch-jk-whole-original-imafgyghxqepguqd.jpeg', '100-dhaniya-pouch-jk-whole-original-imafgyggxap6czhf.jpeg', 0, 'In Stock', '2019-12-28 19:18:53', NULL);
