(243, 10, 33, 'JK Cumin Powder ( জীরা গুড়ো )', 'JK', 23, 26, '<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\" style=\"box-sizing: border-box; margin-bottom: 22px; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"><div id=\"productDescription_feature_div\" class=\"feature\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\" style=\"box-sizing: border-box;\"><div id=\"productDescription_feature_div\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" class=\"a-row feature\" data-cel-widget=\"productDescription_feature_div\" style=\"box-sizing: border-box; width: 971px;\"><div id=\"productDescription\" class=\"a-section a-spacing-small\" style=\"box-sizing: border-box; margin: 0.5em 0px 0em 25px; color: rgb(51, 51, 51); overflow-wrap: break-word; font-size: small; line-height: initial;\"><p style=\"text-align: left; box-sizing: border-box; padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\">Jeera powder is generally added in Indian food</p><p style=\"text-align: left; box-sizing: border-box; padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\">&nbsp;like lentils, vegetables, pulaos,raitas,etc.</p><p style=\"text-align: left; box-sizing: border-box; padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\">&nbsp;Jeera powder gives a nice flavor and taste to</p><p style=\"text-align: left; box-sizing: border-box; padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\">&nbsp;the food.</p></div></div></div></div><div id=\"sponsoredProducts2_feature_div\" class=\"feature\" data-feature-name=\"sponsoredProducts2\" data-cel-widget=\"sponsoredProducts2_feature_div\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"></div><div id=\"dp-ads-middle-3psl\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-fami