(252, 10, 33, 'Gits Dhoka Mix, 100g', 'GITS', 45, 45, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Veg North Indian mixes.</span><br>', '71XtKghi-eL._SL1000_.jpg', '71XsSb6Z3kL._SL1000_.jpg', '81uZP6p0+3L._SL1345_.jpg', 0, 'In Stock', '2019-12-28 19:38:32', NULL),
(255, 10, 33, 'White Sesame Seeds ( সাদা তিল ) - 50 gm.', 'NA', 15, 16, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Health benefits of sesame seeds flavorful, crunchy sesame seeds are widely considered as healthy foods. 100 Grams of seeds carry 573 calories. Although, much of its calorie comes from fats, sesame contains several notable health-benefiting nutrients, minerals, antioxidants and vitamins. The seeds are especially rich in mono-unsaturated fatty acid, oleic acid, which comprises of up to 50 percent of fatty acids in them. Oleic acid helps lower ldl or \"bad cholesterol\" and increases hdl or \"good cholesterol\" in the blood. Research studies suggest that mediterranean diet which is rich in mono-unsaturated fats may help prevent coronary artery disease, and stroke by favoring healthy serum lipid profile. The seeds are also very valuable sources of dietary protein with fine quality amino acids that are essential for growth, especially in children. Just 100 g of seeds provide about 18 g of protein (32 percent of daily-recommended values). Sesame seeds contain many health benefiting compounds such as sesamol (3, 4-methylene-dioxyphenol), sesaminol, furyl-methanthiol, guajacol (2-methoxyphenol), phenylethanthiol and furaneol, vinylguacol, and decadienal. Sesamol and sesaminol are phenolic anti-oxidants. Together, these compounds help stave off harmful free radicals from the human body. Sesame is among the seeds rich in quality vitamins, and minerals. They are very good sources of b-complex vitamins such as niacin, folic acid, thiamin (vitamin b1), pyridoxine (vitamin b6), and riboflavin. 100 G of sesame contains 97 g of folic acid, about 25 percent of recommended daily intake. Folic acid is essential for dna synthesis. When given to expectant mothers during their peri-conception period, it may prevent neural tube defects in the newborns. Niacin is another b-complex vitamin found abundantly in sesame. About 4. 5 Mg or 28 percent of daily-required levels of niacin is provided by just 100 g of seeds. Niacin helps reduce ldl-cholesterol levels in the blood.</span><br>', '71KXbf0XP7L._SL1024_.jpg', '71SDj5wpWYL._SL1024_.jpg', '11547476070.jpg', 0, 'In Stock', '2019-12-28 19:40:04', NULL),
(259, 10, 33, 'JK  kasuri methi ( কসুরি মেথি ) - 25 gm.', 'JK', 24, 25, '<br>', '11565455651.jpg', '11565455651.jpg', '11565455651.jpg', 0, 'In Stock', '2019-12-28 19:43:50', NULL),
