(263, 10, 33, 'JK Ajwan ( জওয়ান ) - 50 gm.', 'JK', 24, 25, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Also known as Bishops weed or Carom, Ajwan is one of the most celebrated spices commonly employed in Indian and Middle-Eastern cuisines. The strong pungent and aromatic flavor of Ajwan seeds are credited to its therapeutic essential oils.</span><br>', '81Xvfjad8RL._SL1500_.jpg', '51wqbW7d-0L.jpg', '71u1gQL4iuL._SL1000_.jpg', 0, 'In Stock', '2019-12-28 19:46:07', NULL),
