(274, 10, 33, 'Everest Hing Powder ( হিং পাউডার )- 25 gm.', 'Everest', 38, 39, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Mastering masala blending is both an art and science. Given the diversity of culture and the wide variety of distinctive cuisines and taste preferences, prevalent across the length and breadth of India, it is a skill that needs perfection and it’s not easy. Each spice has its own distinct identity in terms of taste, aroma, flavor, color with some even offering numerous health benefits. No wonder, pure spices will always play an integral part in Indian cuisine irrespective of the zone, state, community or the cooking method and hence occupies a very special place of honor.</span><br>', 'everest-hing-powder-yellow.jpg', '11498747861.jpg', '11498747861.jpg', 0, 'In Stock', '2019-12-28 19:54:06', NULL),
(277, 10, 33, 'Everest Sambhar Masala ( সাম্বার মশলা ) - 100 gm.', 'Everest', 59, 60, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Everest Sambhar Masala is one such masala to include the genuine taste of a usual tasty south-Indian sambhar at home.</span><br>', '81fuZs6WuPL._SL1500_.jpg', '81yLkUSKEPL._SL1500_.jpg', '71G29smUdNL._SL1166_.jpg', 0, 'In Stock', '2019-12-28 19:56:49', NULL),
(278, 12, 26, 'BISK FARM SUGAR FREE BISCUITS - CREAM CRACKER - 300', 'BISK FARM', 32, 35, '<br>', '11507536528.jpg', '11507536528.jpg', '', 0, 'In Stock', '2019-12-28 19:57:31', NULL),
(280, 10, 33, 'JK Methi ( মেথি ) - 50 gm', 'JK', 12, 13, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Fenugreek Seeds, also known as Methi, is a common ingredient in Indian Subcontinent cuisine. Employed in both the forms as whole and ground, these Seeds are often roasted to reduce their bitterness and enhance their flavor. Fenugreek Seeds are thought to act as galactagogues that are often used to increase milk supply in lactating women.</span><br>', '11486466693.jpg', '11486466693.jpg', '11486466693.jpg', 0, 'In Stock', '2019-12-28 19:58:43', NULL),
(282, 10, 33, 'JK Panch Foron ( পাঁচ ফোড়ন ) - 50 GM', 'JK', 19, 20, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Panch Foran is a whole spice blend used in Bangladesh and Eastern India. The name literally means “five spices” in Maithili (Paanch Phorana). All of the spices in Panch Foran are seeds. Typically, Panch Foran is a blend of fenugreek seed, nigella seed, cumin seed, celery and fennel seed in equal parts.</span><br>', 'panch-phoran-500x500.jpeg', 'jk-panch-foron.gif', 'jk-panch-foron.gif', 0, 'In Stock', '2019-12-28 20:00:21', NULL),
(283, 10, 33, 'JK Kala Jeera ( কালো জীরা ) - 50 gm.', 'JK', 23, 25, '<br>', '11486466541.jpg', '11486466541.jpg', '11486466541.jpg', 0, 'In Stock', '2019-12-28 20:02:03', NULL),
(284, 10, 33, 'JK Sarsoo Red ( লাল সারিষা ) - 50 gm.', 'JK', 10, 11, '<br>', '11486466489.jpg', '11486466489.jpg', '11486466489.jpg', 0, 'In Stock', '2019-12-28 20:05:43', NULL),
(286, 10, 33, 'JK Jeera Whole ( গোটা জিরা ) 50gm', 'JK', 23, 26, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Cumin is the dried seed of the herb Cuminum cyminum, a member of the parsley family. In India, cumin has been used for millennia as a traditional ingredient of many spices &amp; dishes. Cumin Seeds are also known as Jeera in India. Cumin can be used in the powder form or as whole seeds. It imparts a dash of earthy and warm feeling to the cuisine.</span><br>', 'cumin_seed.png', 'cumin-seed-500x500.jpeg', 'JK_Jeera_Whole.jpg', 0, 'In Stock', '2019-12-28 20:14:47', NULL),
(287, 10, 33, 'Everest Meat Masala, 50g ', 'Everest', 37, 38, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Try out variations of meat preparations, with this basic mix from Everest Masala that arrives with all the accurate ingredients for flawless flavour.</span><br>', '91tmE8VS7xL._SL1500_.jpg', '91FEQyyOfUL._SL1500_.jpg', '91p7kCz-GfL._SL1500_.jpg', 0, 'In Stock', '2019-12-28 20:18:12', NULL),
