(290, 10, 33, 'Everest Chicken Masala : 50 gm', 'Everest', 38, 40, '<span style=\"color: rgb(85, 89, 92); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">In this blend, the flavouring agents marginally predominate the taste elements. Consequently the blend is less steeped in pungency. For chicken curry, this gives the right balance between the spice-elements and other ingredients in the dish.</span><br style=\"box-sizing: inherit; color: rgb(85, 89, 92); font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px;\">', 'IPowderMasala50gmEVRS3731XX290216_1_B.jpg', '11486465753.jpg', '81848Zm7SAL._SL1500_.jpg', 0, 'In Stock', '2019-12-28 20:27:41', NULL),
