(293, 10, 33, 'Everest Meat Masala – 10 gm Pouch', 'Everest', 5, 5, '<p><em style=\"box-sizing: border-box;\"><span style=\"box-sizing: border-box; font-weight: bolder;\"><font size=\"2\" style=\"\" face=\"arial\">Everest Meat Masala is one such masala to arrange the delectable tasty meat. A pepper-coriander-chilli based combine that imparts a dark tan and a hot taste to non-veg dishes, particularly meat. Since Indians loves their meat actually spiced up, a fair amount of flavoring spices lend this merge a sweet-smelling chorus.</font></span></em></p>', '11545807229.jpg', '71kOIFDTByL._SL1500_.jpg', '71kcY1qPJoL._SL1500_.jpg', 0, 'In Stock', '2019-12-28 20:35:05', NULL),
(294, 10, 33, 'Sunrise Mustard Powder ( সরষেে গুড়ো )', 'SUNRISE ', 15, 15, '<span style=\"color: rgb(0, 0, 0); font-family: font-regular;\">Sunrise is a leading producer of spices.With decades of industry experience, the company focuses on providing quality spices and food ingredients to the consumers. The company’s brand philosophy is based on bringing newer innovations to the market and better quality spices to the consumers.</span><br>', 'download.jpg', 'Sunrise-Pure-Mustard-Powder-1535183706-10049363-2.jpg', '11507132682.jpg', 0, 'In Stock', '2019-12-28 20:38:07', NULL),
