(298, 10, 33, 'Labanga- Clove ( লবঙ্গ ) 25 gm', 'NA', 20, 22, '<span style=\"color: rgb(99, 99, 99); font-family: &quot;Helvetica Neue&quot;, Verdana, Arial, sans-serif; font-size: 14px; text-align: justify;\">Cloves or Laung are the immature unopened flower buds of a tropical tree. Their flavour can be termed as sweetly pungent, astringent and strongly aromatic. Moreover, this ancient culinary spice is used in cuisines all over the world. Apart from food, it is used for flavoring some wines and alcoholic beverages as well. Cloves(Laung, Lavang) are an excellent source of vitamins and minerals.</span><br>', '11557569566.jpg', '11512424007.jpg', 'cloves-on-wooden-spoon.jpg', 0, 'In Stock', '2019-12-28 20:44:43', NULL),
(300, 10, 33, 'Gol Morich (Black Pepper Whole)', 'NA', 17, 18, '<span style=\"font-family: Lato; font-size: 14px;\">Black peppercorns are the hand-picked fruits of a tropical vine known by the botanical name of Piper nigrum. Before the fruits or drupes are set out in the sun to dry, they are subjected to a hot water bath. Aside from removing impurities and debris, this process makes them dry faster because certain enzymes responsible for the glycation or browning of the berries escape cell membranes as they break down in response to the heat.</span><br>', '51W-DKmQRcL.jpg', '11486460683.jpg', '11486460683.jpg', 0, 'In Stock', '2019-12-28 20:48:05', NULL),
(301, 10, 33, 'Kabab Chini ( কাবাব  চিনি ) 100gm', 'NA', 66, 68, '<span style=\"box-sizing: border-box; opacity: 1; min-width: 0px; max-width: none; min-height: 0px; max-height: none; margin: 0px; padding: 0px; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-shadow: none; transform: none; transform-origin: center center; transition: none 0s ease 0s; font-weight: 600; border: 0px; font-size: 14px; position: static; z-index: auto; outline: none; color: rgb(51, 51, 51); font-family: &quot;Proxima Nova&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif;\">Cubeb or tailed pepper</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Proxima Nova&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 14px;\">&nbsp;is a plant cultivated for its essential oil and fruit with strong fragrance. Kabab Chini is also called as Java pepper because use it is mostly grown in Java and Sumatra. Cubebs are of carefully dried berries, which are similar to black pepper in appearance, but with stalks attached the \"tails\" in&nbsp;</span><span style=\"box-sizing: border-box; opacity: 1; min-width: 0px; max-width: none; min-height: 0px; max-height: none; margin: 0px; padding: 0px; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-shadow: none; transform: none; transform-origin: center center; transition: none 0s ease 0s; font-weight: 600; border: 0px; font-size: 14px; position: static; z-index: auto; outline: none; color: rgb(51, 51, 51); font-family: &quot;Proxima Nova&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif;\">\"tailed pepper”&nbsp;</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Proxima Nova&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 14px;\">. Kabab Chini is a culinary spice. The odor of tail pepper is agreeable and aromatic. The taste is pungent, slightly bitter, acrid and persistent.&nbsp;</span><span style=\"box-sizing: border-box; opacity: 1; min-width: 0px; max-width: none; min-height: 0px; max-height: none; margin: 0px; padding: 0px; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; box-shadow: none; transform: none; transform-origin: center center; transition: none 0s ease 0s; font-weight: 600; border: 0px; font-size: 14px; position: static; z-index: auto; outline: none; color: rgb(51, 51, 51); font-family: &quot;Proxima Nova&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif;\">Tail Pepper</span><span style=\"color: rgb(51, 51, 51); font-family: &quot;Proxima Nova&quot;, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Arial, sans-serif; font-size: 14px;\">&nbsp;is used as a flavoring agent for gins and cigarettes in the West, and as a seasoning for food in Indonesia and mainly used as medicinal use in south Asia.</span><br>', '9474-05.jpg', '1097025399.jpg', 'kabab-chini.jpg', 0, 'In Stock', '2019-12-28 20:49:46', NULL),
(302, 10, 33, ' Everest Masala Powder - Tandoori Chicken, 100g', 'Everest', 38, 39, '<span style=\"color: rgb(51, 51, 51); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: small;\">Everest Tandoori Chicken Masala-This Everest blend strikes an even balance between aromatic and flavouring spice agents to give chicken a luscious, inviting flavour.</span><br>', '61vQnrcYS2L._SL1000_.jpg', '61UJegBt2LL._SL1000_.jpg', '51tj0pLmRRL._SL1000_.jpg', 0, 'In Stock', '2019-12-28 20:53:01', NULL),
