(430, 14, 15, 'Pampers Xtra Large New Monthly Box - 112 Diaper Pants, 112 pcs', 'Pampers', 1300, 2199, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Pampers baby diaper pants are the only pants in India with new air channels providing your baby with a new type of dryness overnight; breathable dryness. Magic Gel that locks the wetness away for up to 12 hours of dryness. The new and improved product design enables a comfortable fit, closer to the babys body. A flexible waistband that adapts to the babys movements for a comfortable fit. Baby lotion with aloe vera helps protect your babys delicate skin from diaper rash and irritation. A top layer with the cotton-like soft material, for a comfortable nights sleep. Fun exterior graphics; fun designs and characters to enjoy with your baby.</span><br>', '1577686582300.jpg', '1577686598416.jpg', '1577686593304.jpg', 0, 'In Stock', '2019-12-30 06:19:01', NULL),
(431, 14, 15, 'Pampers Active Baby Medium - 90 Diaper Pants, 90 pcs Pouch', 'Pampers', 1100, 1500, '<p style=\"box-sizing: border-box; font-family: ProximaNova; font-size: 1.4rem; background-image: inherit; background-position: inherit; background-size: inherit; background-repeat: inherit; background-attachment: inherit; background-origin: inherit; background-clip: inherit; outline: none; border: none; color: rgb(143, 143, 143); line-height: 18.2px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: transparent !important;\">With 5 Star Skin Protection, these are the best tape style diapers from Pampers, with an outer layer of cotton-like softness, this baby diaper provides intense care to your baby sensitive skin and protects it effectively from friction rash and redness.&nbsp;</p><p style=\"box-sizing: border-box; font-family: ProximaNova; font-size: 1.4rem; background-image: inherit; background-position: inherit; background-size: inherit; background-repeat: inherit; background-attachment: inherit; background-origin: inherit; background-clip: inherit; outline: none; border: none; color: rgb(143, 143, 143); line-height: 18.2px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: transparent !important;\">These soft and comfort fitting diapers with stretchable sides are best for your baby rest and playtime. The diapers fastening tape sticks multiple times thus ensuring it stays in place even after you fasten it after checking your baby diaper.&nbsp;</p><p style=\"box-sizing: border-box; font-family: ProximaNova; font-size: 1.4rem; background-image: inherit; background-position: inherit; background-size: inherit; background-repeat: inherit; background-attachment: inherit; background-origin: inherit; background-clip: inherit; outline: none; border: none; color: rgb(143, 143, 143); line-height: 18.2px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: transparent !important;\">Protection and nourishment of your baby skin are taken care of with extracts of moisturising Aloe Vera lotion, characteristic of these best baby diapers. These diapers are ultra-thin, thanks to the absorbent gel material (AGM), commonly known as Magic Gel.&nbsp;</p><p style=\"box-sizing: border-box; font-family: ProximaNova; font-size: 1.4rem; background-image: inherit; background-position: inherit; background-size: inherit; background-repeat: inherit; background-attachment: inherit; background-origin: inherit; background-clip: inherit; outline: none; border: none; color: rgb(143, 143, 143); line-height: 18.2px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: transparent !important;\">This magic gel core of Pampers diapers is highly effective in absorbing frequent wetness. Naturally, your baby skin remains dry for upto12 hours, now no more frequent diaper changing or blow leaks for your little angel.</p><p style=\"box-sizing: border-box; font-family: ProximaNova; font-size: 1.4rem; background-image: inherit; background-position: inherit; background-size: inherit; background-repeat: inherit; background-attachment: inherit; background-origin: inherit; background-clip: inherit; outline: none; border: none; color: rgb(143, 143, 143); line-height: 18.2px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: transparent !important;\">Pampers Active Baby Diapers have been designed to enhance your baby comfort while they are busy in their daily activities. New Pampers with magic gel can absorb quicker and hence keep the skin dry for up to 10 hours.&nbsp;</p><p style=\"box-sizing: border-box; font-family: ProximaNova; font-size: 1.4rem; background-image: inherit; background-position: inherit; background-size: inherit; background-repeat: inherit; background-attachment: inherit; background-origin: inherit; background-clip: inherit; outline: none; border: none; color: rgb(143, 143, 143); line-height: 18.2px; margin-bottom: 0px; padding: 0px; -webkit-tap-highlight-color: transparent !important;\">So your baby skin will be dry throughout the night and give him a peaceful, undisturbed golden sleep. It has a lotion with aloe vera extract to protect baby skin.</p>', '1577687050624.jpg', '1577687058650.jpg', '1577687067752.jpg', 0, 'In Stock', '2019-12-30 06:24:53', NULL),
(433, 14, 15, 'Pampers Active Baby Small (3-8 kg) - 46 Diapers, 46 pcs', 'Pampers', 680, 800, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">5 Star Skin Protection- The Best tape style diapers from Pampers, with an outer layer of cotton-like softness, this baby diaper provides intense care to your baby sensitive skin and protects it effectively from friction rash and redness. These soft and comfort fitting diapers with stretchable sides are best for your baby&nbsp; rest and playtime. The diapers fastening tape sticks multiple times thus ensuring it stays in place even after you fasten it after checking your baby diaper. Protection and nourishment of your baby skin are taken care of with extracts of moisturising Aloe Vera lotion, characteristic of these best baby diapers. These diapers are ultra-thin, thanks to the absorbent gel material (AGM), commonly known as Magic Gel. This magic gel core of Pampers diapers is highly effective in absorbing frequent wetness. Naturally, your baby skin remains dry for upto12 hours, now no more frequent diaper changing or blow leaks for your little angel.</span><br>', '1577688820996.jpg', '1577688828491.jpg', '1577688838154.jpg', 0, 'In Stock', '2019-12-30 06:59:02', NULL),
