(467, 10, 18, 'Emami Healthy & Tasty Kachi Ghani Mustard Oil Bottle - 500 ML', 'Emami', 62, 67, '<div id=\"descriptionAndDetails\" class=\"a-section a-spacing-extra-large\" style=\"box-sizing: border-box; margin-bottom: 22px; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"><div id=\"productDescription_feature_div\" class=\"feature\" data-feature-name=\"productDescription\" data-cel-widget=\"productDescription_feature_div\" style=\"box-sizing: border-box;\"><div id=\"productDescription_feature_div\" data-feature-name=\"productDescription\" data-template-name=\"productDescription\" class=\"a-row feature\" data-cel-widget=\"productDescription_feature_div\" style=\"box-sizing: border-box; width: 1313px;\"><div id=\"productDescription\" class=\"a-section a-spacing-small\" style=\"box-sizing: border-box; margin: 0.5em 0px 0em 25px; color: rgb(51, 51, 51); overflow-wrap: break-word; font-size: small; line-height: initial;\"><p style=\"box-sizing: border-box; padding: 0px; margin-top: 0em; margin-bottom: 1em; margin-left: 1em;\">It has more antioxidants and vitamins than any other normal oil. It is very helpful in preventing early ageing and is cholesterol free. It heart friendly cooking oil. This kachi ghani mustard oil is also widely used for cooking foods. We offer our range of kachi ghani mustard oil in consumer pack different sizes from 5l pack to 50 ml pack in tins, jars, bottles and pouches as per our clients’ requirements.</p><div><br></div></div></div></div></div><div id=\"imageBlockVariations_feature_div\" class=\"feature\" data-feature-name=\"imageBlockVariations\" data-cel-widget=\"imageBlockVariations_feature_div\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"></div><div id=\"cf-ask-cel\" class=\"celwidget\" data-cel-widget=\"cf-ask-cel\" style=\"box-sizing: border-box; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"><div