(469, 10, 18, 'Saffola Gold Oil Pouch - Pro Healthy Lifestyle - 1 LTR', 'Saffola ', 139, 159, '<p style=\"box-sizing: border-box; margin: 2.4pt 0in 9.6pt; padding: 0px; color: rgb(102, 102, 102); font-size: 15px; font-family: Calibri, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><span style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px; font-size: 14px; font-family: Roboto; color: black;\">Are you pushing for a healthy lifestyle even amongst the hustles of the modern days? Today our food habits, stress &amp; activity level affect both our health &amp; heart. But health can also be a part of your life when you find your own way of being healthy. Choose Saffola Gold cooking oil, which partners your journey for a healthy lifestyle so that you have a healthy heart.</span></p><p style=\"box-sizing: border-box; margin: 2.4pt 0in 9.6pt; padding: 0px; color: rgb(102, 102, 102); font-size: 15px; font-family: Calibri, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><span style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px; font-size: 14px; font-family: Roboto; color: black;\">Saffola Gold, Pro Healthy Lifestyle Edible Oil, takes care of you and your family by bringing together the benefits of natural Antioxidant, MUFA, PUFA and Vitamins A and D, thus the power of blended cooking oil offers Improved Nutritional Profile, with Losorb technology which ensures 20% less oil absorption in your food, hence blended