(470, 10, 18, 'Sundrop Gold Lite Oil - 5 LTR', 'Sundrop', 663, 663, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Sundrop Lite Oil is a scientific blend of Refined Sunflower Oil (80%) and Refined Soyabean Oil (20%). It is a light colored &amp; nutritious blend, which offers Natural Vitamin E and meets its 100% Recommended Dietary Allowance. It also contains Omega 6 which is essential for important physiological functions.</span><br>', '40018357_6-sundrop-lite-oil.jpg', '40018357-2_8-sundrop-lite-oil.jpg', '40018357-3_8-sundrop-lite-oil.jpg', 0, 'In Stock', '2020-01-01 19:22:28', NULL),
