(472, 10, 18, 'Sundrop Super Lite Advanced Sunflower Oil - 1 LTR', 'Sundrop', 193, 197, '<span style=\"color: rgb(0, 0, 0); font-family: SourceSansPro-Regular; font-size: 15px;\">Sundrop Super Lite Advanced - Oil 1 Ltr Pouch. Sundrop Country of Origin:India Food Preference:Vegetarian. The images represent actual product though color of the image and product may slightly differ. Sundrop Super Lite Advanced - Sunflower Oil make sure that the absorption of oil is less while cooking, as compared to at all ordinary oil. Its higher refining process makes it extra light. It is also fortified with sufficient quantity of Vitamin A and Vitamin D which takes care of 25% of every day requirement of these necessary vitamins. NUTRITIONAL FACTSEnergy: 900 Kcal Protein: 0 g Carbohydrate: 0 g Saturated Fatty Acids: 9 g Mono Unsaturated Fatty Acids: 25 g Polyunsaturated Fatty acids: 66 g Trans Fatty Acids: 100 g Cholesterol: 0 mg. HOW TO USEIt is used for cooking, frying.</span><br>', '11514275441.jpg', '255499-2_2-sundrop-super-lite-advanced-sunflower-oil.jpg', '255499-4_2-sundrop-super-lite-advanced-sunflower-oil.jpg', 0, 'In Stock', '2020-01-01 19:27:54', NULL),
