(489, 15, 28, 'Vim Dishwash Gel - Lemon, 250 ml', 'Vim', 45, 50, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular; background-color: rgb(10, 13, 19);\">Vim is a quality product from Hindustan Unilever Limited. Launched in 1993, Vim is the original hand dishwashing brand which created the whole category. Vim continues to lead the market and is the biggest player in the category. Vim was the first brand to introduce dishwasher gel in India and has been the leader in the segment since introduction with 7 out of 10 gel dishwasher consumers using Vim Gel.&nbsp;</span><br style=\"box-sizing: border-box; color: rgb(143, 143, 143); font-family: ProximaNova-Regular; background-color: rgb(10, 13, 19); -webkit-tap-highlight-color: transparent !important;\"><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular; background-color: rgb(10, 13, 19);\">Vim Gel, with the power of 100 lemons, gives you complete cleaning without leaving any residue, unlike Dishwash Bars. It is also great value for money with one spoon of Vim Gel being enough to clean a full sink of dirty utensils. Its superior fragrance leaves your utensils smelling fresh, while its pH neutral formula is gentle on your hands. It also keeps your expensive utensils like non-stick cookware looking new for longer as it cleans without scratching the surface and is recommended by Prestige and Nirlep for their range of non-stick cookware.&nbsp;</span><br style=\"box-sizing: border-box; color: rgb(143, 143, 143); font-family: ProximaNova-Regular; background-color: rgb(10, 13, 19); -webkit-tap-highlight-color: transparent !important;\"><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular; background-color: rgb(10, 13, 19);\">For cooking vessels, add a drop of Vim gel directly on the scrubber and wash to get rid of tough stains. For other utensils, tiffins and dishes, take a spoonful of Vim, mix it in a bowl of water use the mixture to wash. So go ahead and enjoy the Vim Gel experience.</span><br>', '1578057465006.jpg', '1578057468611.jpg', '1578057506807.jpg', 0, 'In Stock', '2020-01-03 13:20:25', NULL),
