(504, 14, 17, 'Johnson & Johnson Baby Shampoo', 'Johnson', 360, 370, '<span style=\"color: rgb(102, 102, 102); font-family: ProximaNova-Regular;\">Johnsons Baby Shampoo helps wash your little ones mane. It is calm on your babys scalp and rinses speedily. The No More Tears baby shampoo does not aggravate the eyes and it is well-known to be largely hypo-allergenic, as claimed with the label. Further, the hypoallergenic baby shampoo leaves your babys hair look smelling pleasant and shiny.</span><br>', '262921_17-johnson-johnson-baby-shampoo.jpg', '262921-2_16-johnson-johnson-baby-shampoo.jpg', '262921-3_19-johnson-johnson-baby-shampoo.jpg', 0, 'In Stock', '2020-01-20 15:58:06', NULL),
(505, 8, 22, 'Tomato ( টমেটো )', 'NA', 35, 40, '<b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">Tomato</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">&nbsp;is used for preventing cancer of the breast, bladder, cervix, colon and rectum, stomach, lung, ovaries, pancreas, and prostate. It is also used to prevent diabetes, diseases of the heart and blood vessels (cardiovascular disease), cataracts, and asthma.</span><br>', 'tomato.jpg', '40075161-2_1-fresho-tomato-hybrid.jpg', '40075161-4_1-fresho-tomato-hybrid.jpg', 0, 'In Stock', '2020-01-20 16:00:07', NULL),
(506, 14, 56, 'Nestle Cerelac Fortified Baby Cereal With Milk, Multigrain Dal Veg - From 12 Months, 300 g', 'Nestle', 252, 260, '<p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\">Nestle Cerelac Fortified Baby Cereal with Milk, Multigrain Dal Veg is a complementary food for babies from 12 months onwards. While infants and children have higher requirements of nutrients than adults, 2 serves of Cerelac Multigrain Dal Veg Cereal provides 55% of a baby’s daily need of iron. Also a source of 17 important nutrients including vitamins and minerals, Cerelac Multigrain Dal Veg Cereal is free from added colours, flavours and preservatives.</p><p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\">Nestle develops infant nutrition products backed by evolving science and research. Innovation has been at the heart of Nestle since its beginning.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><strong style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px;\">Important Notice:</strong>&nbsp;Mother’s milk is best for your baby.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><strong style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px;\">Safety Warnings</strong>: Infant food shall be introduced only (after the age of 6 months up to the age of two years). Infant food should be used only on the advice of a health worker as to the need for its use and the proper method of its use. Infant food is not the sole source of nourishment for an infant. Use prepared feed within half an hour otherwise microbial deterioration may set in. Discard unused feed.</p>', '240149_9-nestle-cerelac-fortified-baby-cereal-with-milk-multigrain-dal-veg-from-12-months.jpg', '240149-2_7-nestle-cerelac-fortified-baby-cereal-with-milk-multigrain-dal-veg-from-12-months.jpg', '240149-3_6-nestle-cerelac-fortified-baby-cereal-with-milk-multigrain-dal-veg-from-12-months.jpg', 0, 'In Stock', '2020-01-20 16:04:49', NULL),
(507, 14, 56, 'Nestle Cerelac Fortified Baby Cereal With Milk, Multigrain & Fruits - From 12 Months, 300 g Bag-In-Box', 'Nestle', 252, 260, '<p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\">Nestle Cerelac Fortified Baby Cereal with Milk, Multigrain &amp; Fruits is a complementary food for babies from 12 months onwards. While infants and children have higher requirements of nutrients than adults, 2 serves of Cerelac Multigrain &amp; Fruits Cereal provides 55% of a baby’s daily need of iron. Also a source of 17 important nutrients including vitamins and minerals, Cerelac Multigrain &amp; Fruits Cereal is free from added colours, flavours and preservatives.&nbsp;Nestle develops infant nutrition products backed by evolving science and research. Innovation has been at the heart of Nestle since its beginning.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><strong style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px;\">Important Notice:</strong>&nbsp;Mother’s milk is best for your baby.&nbsp;</p><p style=\"box-sizing: border-box; margin-bottom: 0px; padding: 0px; color: rgb(102, 102, 102); font-family: ProximaNova-Regular; -webkit-tap-highlight-color: rgb(255, 255, 255) !important;\"><strong style=\"box-sizing: border-box; -webkit-tap-highlight-color: rgb(255, 255, 255) !important; margin: 0px; padding: 0px;\">Safety Warnings</strong>: Infant food shall be introduced only (after the age of 6 months up to the age of two years). Infant food should be used only on the advice of a health worker as to the need for its use and the proper method of its use. Infant food is not the sole source of nourishment for an infant. Use prepared feed within half an hour otherwise microbial deterioration may set in. Discard unused feed.</p>', '240158_10-nestle-cerelac-fortified-baby-cereal-with-milk-multigrain-fruits-from-12-months.jpg', '240158-2_7-nestle-cerelac-fortified-baby-cereal-with-milk-multigrain-fruits-from-12-months.jpg', '240158-3_6-nestle-cerelac-fortified-baby-cereal-with-milk-multigrain-fruits-from-12-months.jpg', 0, 'In Stock', '2020-01-20 16:07:26', NULL),
(513, 8, 27, 'Broccoli', 'NA', 55, 60, '<span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, -apple-system, system-ui, system-ui, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 18px;\">Broccoli is a rich source of&nbsp;</span><a href=\"https://www.medicalnewstoday.com/articles/195878.php\" title=\"What are vitamins, and how do they work?\" class=\"keywords content-link css-29oowu\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; background-color: transparent; cursor: pointer; border-color: currentcolor; color: rgb(5, 162, 211); font-family: &quot;Proxima Nova&quot;, -apple-system, system-ui, system-ui, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 18px;\">vitamins</a><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, -apple-system, system-ui, system-ui, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 18px;\">, minerals, and&nbsp;</span><a href=\"https://www.medicalnewstoday.com/articles/301506.php\" title=\"How can antioxidants benefit our health?\" class=\"keywords content-link css-29oowu\" style=\"-webkit-font-smoothing: antialiased; box-sizing: inherit; background-color: transparent; cursor: pointer; border-color: currentcolor; color: rgb(5, 162, 211); font-family: &quot;Proxima Nova&quot;, -apple-system, system-ui, system-ui, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 18px;\">antioxidants</a><span style=\"color: rgb(35, 31, 32); font-family: &quot;Proxima Nova&quot;, -apple-system, system-ui, system-ui, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 18px;\">. Antioxidants can help prevent the development of various conditions.</span><br>', 'brokoli-222.jpg', 'download (7).jpg', 'download (8).jpg', 0, 'Out of Stock', '2020-01-20 19:24:51', NULL),
