(521, 10, 34, 'Sugar ( চিনি )', 'NA', 40, 42, '<span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">1 : a sweet material that consists essentially of sucrose obtained from sugarcane or&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">sugar</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">&nbsp;beets, is typically colorless or white when pure, and is commonly used to sweeten foods and beverages. 2 : any of numerous soluble and usually sweet carbohydrates (as&nbsp;</span><b style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">glucose</b><span style=\"color: rgb(34, 34, 34); font-family: arial, sans-serif; font-size: 16px;\">&nbsp;or sucrose) that occur naturally especially in plants.</span><br>', 'shutterstock-615908132.jpg', '10-worst-foods-for-diabetes-01.jpg', 'sugar_10.jpg', 0, 'In Stock', '2020-01-26 08:41:57', NULL),
