(526, 9, 40, 'Besan Regular ( বেসন )', 'NA', 72, 75, '<span style=\"box-sizing: border-box; caret-color: rgb(65, 65, 70); color: rgb(65, 65, 70); font-family: Camphor; font-size: 18px;\">Gram flour, more popularly known as besan is a highly nutritions food</span><span style=\"box-sizing: border-box; color: rgb(65, 65, 70); font-family: Camphor; font-size: 18px;\">&nbsp;is rich in fiber, iron, potassium, manganese, copper, zinc, phosphorus, magnesium, folate, vitamin B-6 and thiamine.</span><span style=\"box-sizing: border-box; caret-color: rgb(65, 65, 70); color: rgb(65, 65, 70); font-family: Camphor; font-size: 18px;\">&nbsp; It is rich in protein content and can be easily consumed by vegetarians to fulfil their protein needs. It is also traditionally used as a home made face pack to remove tan and to lighten the skin.</span><br>', 'Besan-Flour.jpg', '51uy3iQz9hL.jpg', 'besan-or-chickpea-flour.png', 0, 'Out of Stock', '2020-01-27 20:21:10', NULL),
