(533, 11, 61, 'Colgate Active Salt Toothpaste, 200 g', 'Colgate', 95, 97, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Colgate Active Salt is an anti-cavity toothpaste with the goodness of salt and minerals which help fight germs. Refreshing minty flavour gives fresher breath when used as directed for oral hygiene. Colgate Active Salts unique formula helps fight germs and provide you with healthier and cleaner teeth. Brush twice a day with Colgate Active Salt toothpaste as recommended by dentists. Colgate is Indias No. 1 brand recommended by Dentists and offers unique oral hygiene solutions to ensure complete protection against germs and plague build-up.</span><br>', '1580211257878.jpg', '1580211260122.jpg', '1580211270730.jpg', 0, 'In Stock', '2020-01-28 11:42:24', NULL),
(534, 11, 61, 'Colgate Active Salt Toothpaste, 100 g', 'Colgate', 52, 52, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Colgate Active Salt is an anti-cavity toothpaste with the goodness of salt and minerals which help fight germs. Refreshing minty flavour gives fresher breath when used as directed for oral hygiene. Colgate Active Salts unique formula helps fight germs and provide you with healthier and cleaner teeth. Brush twice a day with Colgate Active Salt toothpaste as recommended by dentists. Colgate is Indias No. 1 brand recommended by Dentists and offers unique oral hygiene solutions to ensure complete protection against germs and plague build-up.</span><br>', '1580211275535.jpg', '1580211277969.jpg', '1580211280329.jpg', 0, 'In Stock', '2020-01-28 11:48:35', NULL),
(535, 11, 61, 'Colgate Visible White Toothpaste - Dazzling White, Sparkling Mint, 100 g', 'Colgate', 96, 100, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Colgate Visible White Toothpaste is a unique formula which comes infused with Whitening Accelerators (Silica &amp; Pyrophosphate). It safely exfoliates stains and polishes teeth surface for a dazzling white smile. Also, it helps fight cavities along with removing plague as you brush. The soothing minty flavor freshens up breath for refreshing experience and shining teeth. The unique Visible White formula gives 1 shade whiter teeth in 1 week, when used as directed. Colgate Visible White, with anti-cavity fluoride formula, treats extrinsic stains only and protects enamel, to help you make an impression with your dazzling white smile. Colgate is India’s No. 1 brand recommended by dentists and offers unique oral hygiene solutions to ensure complete protection against germs and plague build-up.</span><br>', '1580211299657.jpg', '1580211302248.jpg', '1580211304857.jpg', 0, 'In Stock', '2020-01-28 11:52:15', NULL),
(536, 11, 61, 'Colgate Strong Teeth Anticavity Toothpaste With Amino Shakti, 200 g', 'Colgate', 84, 92, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">&nbsp;</span><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">Your trusted Colgate Strong Teeth Toothpaste now comes with Amino Shakti, a unique formula&nbsp;</span><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">containing Arginine with an insoluble source of calcium and fluoride. This new, best ever Colgate Strong Teeth formula (^vs previous formula), with Amino Shakti, provides 4X strengthening power by providing protection from a mineral loss against acid attack vs. an ordinary fluoride toothpaste. The toothpaste helps add natural calcium from saliva through fluoride action and strengthens teeth from within. This anticavity toothpaste also provides cleaner teeth and fresher breath with regular use, when used as directed as a part of your daily oral care hygiene and regular professional care routine, as directed by a dentist. Colgate, Indias No.1 Toothpaste (#Based on market share data), is always 100% vegetarian toothpaste</span><br>', '1580211034454.jpg', '1580211036656.jpg', '1580211046029.jpg', 0, 'In Stock', '2020-01-28 11:56:39', NULL),
(537, 11, 61, 'Colgate Strong Teeth Anticavity Toothpaste With Amino Shakti, 150 g', 'Colgate', 65, 65, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">&nbsp;</span><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">Your trusted Colgate Strong Teeth Toothpaste now comes with Amino Shakti, a unique formula&nbsp;</span><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova; font-size: 14px;\">containing Arginine with an insoluble source of calcium and fluoride. This new, best ever Colgate Strong Teeth formula (^vs previous formula), with Amino Shakti, provides 4X strengthening power by providing protection from a mineral loss against acid attack vs. an ordinary fluoride toothpaste. The toothpaste helps add natural calcium from saliva through fluoride action and strengthens teeth from within. This anticavity toothpaste also provides cleaner teeth and fresher breath with regular use, when used as directed as a part of your daily oral care hygiene and regular professional care routine, as directed by a dentist. Colgate, Indias No.1 Toothpaste (#Based on market share data), is always 100% vegetarian toothpaste.&nbsp;</span><br>', '1580211086096.jpg', '1580211089434.jpg', '1580211046029.jpg', 0, 'In Stock', '2020-01-28 12:07:47', NULL),
(538, 11, 61, 'Colgate Plax Mouthwash - Peppermint Fresh, 250 ml', 'Colgate', 120, 115, '<span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Protect your mouth from germs and get fresh breath every morning with Colgate Plax Peppermint Fresh Mouthwash which gives 10x longer cooling sensation. It removes over 99% of bad breath causing germs in your mouth, for a fresher and cleaner mouth than brushing alone. Colgate Plax Peppermint Fresh Mouthwash contains a strong Peppermint flavour that gives a boost of confidence with every use. It is Alcohol-free so you experience no burning sensation, just fresher smiles between brushings! Make Colgate Plax a part of your daily oral hygiene.&nbsp;</span><span style=\"color: rgb(143, 143, 143); font-family: ProximaNova-Regular;\">Use it twice a day after brushing, for a cleaner, fresher and healthier mouth. When used as directed, Colgate Plax mouthwash can also help prevent cavities, protect against germ build-up and provide healthier gums vs. non-antiseptic mouthwash, when used as directed.</span><br>', '1580211176697.jpg', '1580211180513.jpg', '1580211183423.jpg', 0, 'In Stock', '2020-01-28 12:12:09', NULL),
(539, 11, 61, 'Pepsodent', 'Pepsodent', 72, 85, '<span style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px;\">While we work to ensure that product information is correct, on occasion manufacturers may alter their ingredient lists. Actual product packaging and materials may contain more and/or different information than that shown on our web site. We recommend that you do not solely rely on the information presented and that you always read labels, warnings, and directions before using or consuming a product. For additional information about a product, please contact the manufacturer.</span><br>', '41ard2JXctL._AC_SY400_FMwebp_.jpg', '41lU1ESLMOL._AC_SY400_FMwebp_.jpg', 'pepsodent_germi_check_cavity_protection_toothpaste_100_gm_4.jpg', 0, 'In Stock', '2020-01-28 13:19:48', NULL),
