(543, 11, 60, 'Dettol-75gm×4', 'Dettol', 92, 107, '<span style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px;\">It cleanses and protects your skin keeping you healthy every day. Personal hygiene play a critical role in preventing the spread of illness and infection. Poor personal hygiene can cause infection, skin complaints, unpleasant smells and skin infections. Skin is our first line of defence from the outside world and by keeping skin clean and moisturised, the barrier function will stay intact and overall health and appearance of skin will be improved. Reassuringly, Dettol protects from a wide range of illness causing germs and bacteria to help you stay healthy.</span><br>', '51uR10BlCGL._AC_SY700_FMwebp_.jpg', '51NC6V+gjXL._AC_SY700_FMwebp_.jpg', '418JRJmK2EL._AC_SY700_FMwebp_.jpg', 0, 'In Stock', '2020-01-28 13:54:30', NULL),
