(546, 11, 60, 'Dove-100gm×3', 'Dove', 140, 172, '<span style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px;\">Just rub this Dove bar between your hands and smooth the cleansing lather over your skin before rinsing away. Pat dry. For best results, use twice a day, morning and evening.</span><br>', '41tIV4lnN6L._AC_SY700_FMwebp_.jpg', '41RH+ZairtL._AC_SY350_FMwebp_.jpg', '41eRo1TRK0L._AC_SY350_FMwebp_.jpg', 0, 'In Stock', '2020-01-28 14:15:41', NULL),
