(550, 10, 34, 'White Sugar Candy', 'na', 30, 40, '<span style=\"color: rgb(81, 88, 95); font-family: -apple-system, blinkmacsystemfont, &quot;segoe ui&quot;, roboto, oxygen-sans, ubuntu, cantarell, &quot;helvetica neue&quot;, helvetica, arial, sans-serif; font-size: 14.4px;\">According to Ayurveda, rock sugar is a coolant which is known for its vata and pitta reducing properties. It is more healthier than sugar because it is purified naturally. Rock sugar is very rich in essential vitamins, minerals and amino acids. It is believed to have an important vitamin- B-12, which is rarely found in vegetarian food.</span><br>', 'Tal-misri-600x465.jpg', 'white-Lump-sugar-refined-from-sugar-cane.jpg', 'b19food008.jpg', 0, 'In Stock', '2020-01-28 14:28:12', NULL),
(551, 10, 34, 'Batasa 500gm', 'na', 35, 40, '<h2 style=\"box-sizing: border-box; outline: none; font-family: Roboto, sans-serif; color: rgb(34, 34, 34); margin-bottom: 2px; padding: 0px; cursor: default; line-height: 18px; font-size: 14px; font-weight: 400; overflow: hidden; text-overflow: inherit; overflow-wrap: break-word;\"><a class=\"img-popup-link2\" href=\"https://thumbs.dreamstime.com/z/indian-sweet-batasha-batasa-which-just-refined-sugar-various-shapes-cheaper-than-other-sweets-therefore-117896714.jpg\" style=\"box-sizing: border-box; outline: 0px; background-color: transparent; color: rgb(17, 125, 240); transition: all 0.1s ease-in-out 0s;\">Batasa is an indian sweet which is just refined sugar in various shapes. These are cheaper than other sweets and therefore preferred in less important festivals.</a></h2>', 'sugar-batasa-500x500.jpg', 'maxresdefault.jpg', '11505638812.jpg', 0, 'In Stock', '2020-01-28 14:37:16', NULL),
