(555, 10, 35, 'Kissan Fresh Tomato Ketchup, 950g', 'Kissan', 124, 130, '<ul class=\"a-unordered-list a-vertical a-spacing-none\" style=\"box-sizing: border-box; margin-bottom: 0px; margin-left: 18px; color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif;\"><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Made with 100 percent real tomatoes</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Turns a boring meal into an empty tiffin</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Enjoy it best with samosas, pakodas, noodles or roti roll for an interesting tiffin meal</span></li><li style=\"box-sizing: border-box; list-style: disc; overflow-wrap: break-word; margin: 0px;\"><span class=\"a-list-item\" style=\"box-sizing: border-box;\">Carefully sealed in impermeable glass packaging to retain the best flavour and taste of product</span></li></ul>', '612CsndBT8L._SL1000_.jpg', '71BW9IQg-+L._SL1000_.jpg', '71HUYLXkI9L._SL1000_.jpg', 0, 'In Stock', '2020-01-28 19:33:34', NULL),
(556, 10, 35, 'Kissan Fresh Tomato Ketchup 1kg Bottle', 'Kissan', 147, 150, '<span style=\"color: rgb(51, 55, 69); font-family: &quot;Open Sans&quot;;\">Kissan is the leading sauce and jam manufacturer brand in India from the house of Hindustan Unilever Limited. Kissan Fresh Tomato Ketchup is one of its products. The natural flavour of the sauce makes the food tastier to eat. Kissan Fresh Tomato Ketchup is available in the market and it is standard product from Kissan. The fresh tomato ketchup is available in the Indian supermarkets and in the online grocery stores. The pack comes in different sizes and they are very cost effective and it can be easily consumed by the common people. The main ingredients of the kissan fresh tomato ketchup are 28 % percent of tomato paste, sugar, salt, acidity regulator, 20 % of stabilizers - 1422 and 415, preservatives 211, onion powder, garlic powder, spices, and condiments. The size of the packs is 200 gm, 500 gm, and 1 kg and also comes with 15 gm pouch pack. The cost of the packs are rupees 28, rupees 74, and rupees 112 respectiveky. Kissan Fresh Tomato Ketchup is recommended to keep in a cool dry place for better sustenance. Thus, Kissan Fresh Tomato Ketchup has great demand in the market.</span><br>', 'Kissan-Fresh-tomato-Ketchup-1kg.jpg', 'images (1).jpg', 'xfresh-tomato-ketchup-490_490_v2.jpg.pagespeed.ic.51wJ2J3ms7 (1).jpg', 0, 'In Stock', '2020-01-28 19:39:17', NULL),
(557, 15, 28, 'Surf excel-1kg', 'Surf excel', 180, 182, '<span style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px;\">While learning new skills and having fun, children often come home with a variety of stains on their clothes. To clean these difficult stains you have to put in extra effort and use additional stain removers. No more! New Surf excel Quickwash with X-tra clean particles combines the power of stain removing products like blue, bleach and lemon. Now you can remove multiple stains with just 1 product. Put your multiple stain worries to rest with Surf excel Quick Wash.</span><br>', '51tNCTREVNL._AC_SY700_FMwebp_.jpg', '41hFPkKV7UL._AC_SY700_FMwebp_.jpg', '416Jf7Dn2mL._AC_SY700_FMwebp_.jpg', 0, 'In Stock', '2020-01-28 19:39:19', NULL),
(558, 15, 28, 'Surf excel- 0.5 kg', 'Surf excel', 80, 82, '<span style=\"color: rgb(17, 17, 17); font-family: &quot;Amazon Ember&quot;, Arial, sans-serif; font-size: 15px;\">Surf Excel Easy Wash Detergent Powder brings the power of ten hands, so that you can sit forget breaking your back scrubbing stains from clothes! Superior technology makes this detergent powder superfine so that it dissolves instantly and begins working on the toughest stains. Let the kids have their fun, just buy the Surf Excel Easy Wash Detergent Powder in this pack of 500 gm and be assured of not dreading your laundry time again!</span><br>', '51SUeYTOJSL._AC_SY700_FMwebp_.jpg', '51q2ltUdfPL._AC_SY700_FMwebp_.jpg', '51vk8pcctPL._AC_SY700_FMwebp_.jpg', 0, 'In Stock', '2020-01-28 19:42:22', NULL),
(559, 15, 28, 'Sunlight -1kg', 'Sunlight', 80, 82, '<span style=\"color: rgb(45, 45, 45); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">New Sunlight Powder with Colourguard Techonology protects your clothes in every wash to keep them bright &amp; colorful for longer. Now your clothes will retain their glaze and feel like new even after 40 washes.</span><br>', 'sunlight-packshot-pouch.jpg', '40055047-2_1-sunlight-detergent-powder.jpg', '40055047_2-sunlight-detergent-powder.jpg', 0, 'In Stock', '2020-01-28 19:56:09', NULL),
(560, 15, 28, 'Sunlight - 500gm', 'Sunlight', 40, 42, '<span style=\"color: rgb(45, 45, 45); font-family: &quot;Open Sans&quot;, sans-serif; font-size: 14px;\">New Sunlight Powder with Colourguard Techonology protects your clothes in every wash to keep them bright &amp; colorful for longer. Now your clothes will retain their glaze and feel like new even after 40 washes.</span><br>', '40055047_2-sunlight-detergent-powder.jpg', '40055049_2-sunlight-detergent-powder.jpg', 'sunlight-packshot-pouch.jpg', 0, 'In Stock', '2020-01-28 19:57:40', NULL),
